INSERT INTO `courses` (`id`, `status`, `instructor_id`, `instructor_name`, `instructor_email`, `course_title`, `s_description`, `description`, `category`, `level`, `language`, `keywords`, `imagePath`, `FAQ`, `Announcements`) VALUES
(140, 'Approved', 4, 'Gayan', 'dderuwan1000@gmail.com', 'React Native Mobile Development', 'React Native is an open-source UI software framework created by Meta Platforms, Inc. It is used to develop applications for Android, Android TV, iOS, macOS, tvOS, Web, Windows and UWP by enabling developers to use the React framework along with native platform capabilities.', '<p>Meta released React Native in 2015 and has been maintaining it ever since.</p><p>In 2018, React Native had the <a href=\\\"https://octoverse.github.com/2018/projects#repositories\\\">2nd highest</a> number of contributors for any repository in GitHub. Today, React Native is supported by contributions from individuals and companies around the world including <a href=\\\"https://callstack.com/\\\">Callstack</a>, <a href=\\\"https://expo.io/\\\">Expo</a>, <a href=\\\"https://infinite.red/\\\">Infinite Red</a>, <a href=\\\"https://www.microsoft.com/\\\">Microsoft</a> and <a href=\\\"https://swmansion.com/\\\">Software Mansion</a>.</p><p>Our community is always shipping exciting new projects and exploring platforms beyond Android and iOS with repos like <a href=\\\"https://github.com/microsoft/react-native-windows#readme\\\">React Native Windows</a>, <a href=\\\"https://github.com/microsoft/react-native-macos#readme\\\">React Native macOS</a> and <a href=\\\"https://github.com/necolas/react-native-web#readme\\\">React Native Web</a>.</p>', 'Mobile Development', 'grade1', 'English', 'MobileDevelopment, ReactNative', '../course/Benefits-of-React-Native-for-Mobile-App-Development.jpg', NULL, NULL),
(142, 'Approved', 60, 'Sunil', 'dderuwan1000@gmail.com', 'Photograpgy', 'Photography is the art of capturing light with a camera, usually via a digital sensor or film, to create an image.', '<p>Photography is <strong>the art of capturing light with a camera, usually via a digital sensor or film, to create an image</strong>.</p>', 'photography', 'grade1', 'English', 'fsdf', '../course/images.jpeg', NULL, NULL),
(143, 'Approved', 60, 'Sunil', 'dderuwan1000@gmail.com', 'Grade 12 Advanced Level Biology', 'You will study biochemical functions, metabolic processes, molecular genetics, homeostasis and population dynamics. The course focuses on the theoretical aspects of the topics under study, and helps you refine skills related to scientific investigation.', '<p>You will study biochemical functions, metabolic processes, molecular genetics, homeostasis and population dynamics. The course focuses on the theoretical aspects of the topics under study, and helps you refine skills related to scientific investigation.</p>', 'Biology', 'grade2', 'Sinhala', 'Biology, Science, Advanced Level', '../course/Biology-4.jpg', NULL, NULL),
(144, 'Pending', 60, 'Sunil', 'dderuwan1000@gmail.com', 'Grade 10 Maths - Ordinary Level', '(Ordinary Level) examination, the subject mathematics stands foremost. The ... The subject content and learning outcomes related to the grade 10 and ', '<p>(<i>Ordinary Level</i>) examination, the subject <i>mathematics</i> stands foremost. The ... The subject content and learning outcomes related to the <i>grade 10</i> and&nbsp;</p>', 'Maths', 'grade10', 'Sinhala', 'Maths', '../course/image.jpg', NULL, NULL);

